define({"topics":[{"title":"Do I need to reinvite my Windows <span class=\"ph\">Airwall Agent<\/span> after I update the software?","shortdesc":"<p class=\"shortdesc\">You do not need to reinvite a device to the network once you have upgraded your <span class=\"ph\">Airwall Agent or Server<\/span>. When you         update, it retains the previously-configured settings and profiles.<\/p>","href":"kb_windows_reinvite.html","attributes":{"data-id":"kb_windows_reinvite"},"menu":{"hasChildren":false},"tocID":"kb_windows_reinvite-d8884e16188","topics":[]},{"title":"Set a Preferred Network to Cellular on an Android <span class=\"ph\">Airwall Agent<\/span>","shortdesc":"<p class=\"shortdesc\">Most Android devices will not use Cellular if either Wifi or Ethernet is available.         If you want to set your Preferred Network to Cellular, most devices require that you enable             <strong class=\"ph b\">Mobile data always active<\/strong> in your device's Developer options.<\/p>","href":"kb_android_cell_network.html","attributes":{"data-id":"kb_android_cell_network"},"menu":{"hasChildren":false},"tocID":"kb_android_cell_network-d8884e16205","topics":[]},{"title":"Set your preferred network in the macOS <span class=\"ph\">Airwall Agent<\/span>","shortdesc":"<p class=\"shortdesc\"\/>","href":"kb_mac_cell_network.html","attributes":{"data-id":"kb_mac_cell_network"},"menu":{"hasChildren":false},"tocID":"kb_mac_cell_network-d8884e16221","topics":[]},{"title":"Update <span class=\"ph\">Airwall Agents and Servers<\/span>","shortdesc":"<p class=\"shortdesc\">How to update your <span class=\"ph\">Airwall Agent or Server<\/span> by platform.         For Windows, macOS, and Linux, download the latest version from <a class=\"xref\" href=\"content\/topics\/downloads_latest.html\">content\/topics\/downloads_latest.html<\/a>.<\/p>","href":"kb_update_agents.html","attributes":{"data-id":"kb_update_agents"},"menu":{"hasChildren":false},"tocID":"kb_update_agents-d8884e16233","topics":[]},{"title":"Upgrade a macOS <span class=\"ph\">Airwall Agent<\/span> key","shortdesc":"<p class=\"shortdesc\">The macOS <span class=\"ph\">Airwall Agent<\/span> may lose         access to the macOS keychain following an update to 2.2. If this occurs, use the procedure         below to resolve the issue<\/p>","href":"kb_mac_key.html","attributes":{"data-id":"kb_mac_key"},"menu":{"hasChildren":false},"tocID":"kb_mac_key-d8884e16251","topics":[]}]});